import React, { Component } from 'react';
import { VerticalBarSeries, LabelSeries, RadarChart } from 'react-vis';
import './graph_styling.css'

class Genre_Analysis extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <RadarChart
                   data={this.props.radarData}
                   domains={[
                    {name: 'pop', domain: [0, 30]},
                    {name: 'rap', domain: [0, 30]},
                    {name: 'rock', domain: [0, 30]},
                    {name: 'alternative', domain: [0, 30]},
                  ]}
                  height={400}
                  width={400} 
                  style={{
                    polygons: {
                      fillOpacity: 0,
                      strokeWidth: 3
                    },
                    axes: {
                      text: {
                        opacity: 1
                      }
                    },
                    labels: {
                      textAnchor: 'middle'
                    }
                  }}
                  margin={{
                    left: 30,
                    top: 30,
                    bottom: 40,
                    right: 50
                  }}
                  tickFormat={t => ''}
                  width={400}
                  height={300}
                >
                  <CircularGridLines
                    tickValues={[...new Array(10)].map((v, i) => i / 10 - 1)}
                />
                </RadarChart>
            </div>
        );
    }
}

export default Genre_Analysis;
